    alignItems: "center",
    paddingHorizontal: 10,
    paddingVertical: 10,
  },
  storyItem: {
    width: 90,
    height: 130,
    justifyContent: "flex-end",
    alignItems: "center",
    marginRight: 10,
  },
  storyIconContainer: {
    width: 30,
    height: 30,
    borderRadius: 15,
    backgroundColor: "#169dff",
    justifyContent: "center",
    alignItems: "center",
    marginBottom: 5,
  },
  storyName: {
